# ## FUNCTIONS ###


def next_num(val_i, perm):
    for j in range(perm.index(val_i), n):
        if perm[j] > val_i:
            return perm[j]
    return None


def there_isnt(last, val_i, perm):
    next_i = next_num(val_i, perm)
    if next_i is None:
        for j in range(perm.index(val_i) + 1, n):
            if perm[j] > last:
                return False
    elif next_i is not None:
        for j in range(perm.index(val_i) + 1, perm.index(next_i)):
            if last < perm[j] < next_i:
                return False
    return True


def iterator(perm):
    dicti = {}
    for ind, val in enumerate(perm):
        dicti[ind] = [val]
        for key in dicti:
            if val > dicti[key][-1] and there_isnt(dicti[key][-1], val, perm):
                dicti[key].append(val)
    return dicti


